import React from "react";
import Heading from "./Heading";
import Car from "./Car";
import carList from "./CarDictionary";

function carMapping(names){
    return <Car 
        // key={names}
        car={names}
    />;
}

function List(){
    return <div>
        <Heading />
        <ul>
            {carList.map(carMapping)}
        </ul>
    </div>;
}

export default List;
